import java.util.ArrayList;
import java.util.List;

class Solution {
    public List<Integer> lastVisitedIntegers(List<String> words) {
        List<Integer> result = new ArrayList<>();
        List<Integer> nums = new ArrayList<>();
        int prevCount = 0; // Count consecutive "prev"

        for (String word : words) {
            if (word.equals("prev")) {
                prevCount++;
                // If prevCount is more than the numbers seen so far, add -1 to result
                if (prevCount > nums.size()) {
                    result.add(-1);
                } else {
                    // Get the (prevCount - 1)th last visited integer
                    result.add(nums.get(nums.size() - prevCount));
                }
            } else {
                // Reset prevCount on seeing an integer
                prevCount = 0;
                nums.add(Integer.parseInt(word));
            }
        }

        return result;
    }
}
